  onclicke=()=>{
    console.log(  oneproduct.id);
   }
  render()
{
    console.log(this.props.products)
    return this.props.products.map((oneproduct) =>(
        <div style={{ display: 'inline-block',  width:'300px',height: '280px',  border: '1px solid ', margin:20,padding:10,marginLeft:40,
        backgroundColor:'#D3D3D3' }}>
        <OneProduct  key = {oneproduct.id}
        oneproduct = {oneproduct}
        onclicke={this.onclicke}
        id={this.state.id} />
        </div>
        
          ));        
        
}   
}

export default Products;
